css:
.node-debugger {
  color: #99b2b8;
  height: 250px;
}
.node-debugger-editor {
  position: relative;
  overflow: auto;
}
.debugger-panel-heading {
  display: flex;
  flex-direction: column;
  justify-content: center;
  height: 33px;
  line-height: 33px;
  flex-basis: 33px;
  vertical-align: middle;
  background-color: #002b36;
  padding: 0 10px;
}
.list-item.heading {
  background-color: #002b36;
}
atom-text-editor::shadow .gutter .line-number.node-debugger-stop-line:before {
  content: ">";
  color: #99b2b8;
}
atom-text-editor::shadow .gutter .line-number.node-debugger-attached-breakpoint {
  background-color: #F00;
}
atom-text-editor::shadow .gutter .line-number.node-debugger-detached-breakpoint {
  background-color: #FF850B;
}
/*
hack: force width to zero to be able to resize to atom-text-editor element
to solve resizing problem of console pane: https://github.com/kiddkai/atom-node-debugger/issues/109
*/
div.inset-panel atom-text-editor /deep/ .scroll-view div.lines {
  width: 0px !important;
}
